import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
  Paper
} from "@mui/material";

import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';

const Cart1 = () => {
  return (
    <Box className="card_Icon">
      <Card>
      <Button>
        <ShoppingCartIcon />
      </Button>
      </Card>
    </Box>
  );
};

export default Cart1;
